class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        vowels = set(['a', 'e', 'i', 'o', 'u'])
        dp = [1 if c in vowels else 0 for c in s]

        global_max = 0
        curr_max = None
        for i in range(len(s) - k + 1):
            if curr_max == None:
                curr_max = sum(dp[:k])
            else:
                if dp[i-1] == 1:
                    curr_max -= 1
                if dp[i+k-1] == 1:
                    curr_max += 1

            global_max = max(global_max, curr_max)

        return global_max


